import React from 'react';
import InputForm from './components/InputForm';

const App = () => {
  return (
    <div>
      <header className="bg-primary text-white py-3">
        <h1 className="text-center">Healthcare Dashboard</h1>
      </header>
      <InputForm />
    </div>
  );
};

export default App;
